def core1(ss1=[], buffer1=[]):
    len_buffer1 = len(buffer1)
    out_elf = []
    len_ss1 = len(ss1)

    i = 0

    def f(b):
        if b >= 10:
            return (b//10)*16 + (b%10)
        else:
            return b
    
    while i < len_ss1:
        a = ss1[i] ^ f(buffer1[i%len_buffer1])
        if i % len_buffer1 == 33: # bug?
            a = ss1[i] ^ f(buffer1[i%len_buffer1]) ^ ord("L") ^ ord("e")
        out_elf.append(a)
        i += 1
    
    return out_elf

