def core(buffer1=None, buffer2=None):
    in1 = buffer1[:]
    in1_len = len(in1)

    X =  [3,12,10,0,15,14,11,12,11] + in1
    in1_len += 9

    in2 = buffer2[:]

    b11 = in2[0]
    b12 = in2[1]
    b13 = in2[2]
    b21 = in2[3]
    b22 = in2[4]
    b23 = in2[5]
    b31 = in2[6]
    b32 = in2[7]
    b33 = in2[8]

    assert len(in2) == 9, in2

    a1 = X[9]
    a2 = X[10]
    a3 = X[11]

    a4 = X[12]
    a5 = X[13]
    a6 = X[14]

    a7 = X[15]
    a8 = X[16]
    a9 = X[17]

    assert b11+b12+b13 == a4*2, (b11,b12,b13,a4*2) 
    assert b11+b12+b13 < a1+a2+a3, (b11,b12,b13,a1,a2,a3) 
    assert b21+b22+b23 > a4+a5+a6, (b21,b22,b23,a4,a5,a6)
    assert b31+b32+b33 < a7+a8+a9, (b31,b32,b33,a7,a8,a9)

    i = 0
    encodebuf = []
    while i < in1_len:
        a11 = X[i]
        a21 = X[i+1]
        a31 = X[i+2]

        c11 = ( (b11 * a11) + (b12 * a21) + (b13 * a31) ) % 29
        c21 = ( (b21 * a11) + (b22 * a21) + (b23 * a31) ) % 29
        c31 = ( (b31 * a11) + (b32 * a21) + (b33 * a31) ) % 29

        encodebuf.append(c11)
        encodebuf.append(c21)
        encodebuf.append(c31)
        i += 3

    print(f"{encodebuf, len(encodebuf)=}")

    return encodebuf



